    false,nt"url": null,nt"notes": "This is the 1996-1997 fiscal year annual
    narrative report for Neal Smith National Wildlife Refuge (formerly Walnut Creek
    National Wildlife Refuge).  The report begins with information about monitoring
    and studies which include surveys and investigations.  Habitat restoration is also
    covered, followed by habitat management.  Fish and wildlife management are discussed
    next; topics include bird banding, disease treatment, and animal control.  Coordination
    activities are outlined, as well as resource protection.  Resource protection activities
    include law enforcement, permitting, and land acquisition.  Information about public
    education and recreation is given.  Finally, refuge planning and administration
    is discussed.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
